    const Hero=styled.section`
        margin-top:64px;
        height: 40vh;
        position: relative;
        background-image:url(${hero});
        background-color:rgb(106,106,179,.5);
        background-size: 100%;
        background-repeat: no-repeat;
        ${'' /* background-position:right; */}
        .parent{
            display:flex;
            flex-direction:column;
            padding: 20px 0px;
            height: 40vh;
            justify-content: space-around;
            .section{
                flex-basis:100%;
            }
            .part1{
                h1{
                    position:relative;
                    overflow: hidden;
                    padding-left: 20px;
                    &::before{
                        content: "";
                        position: absolute;
                        width: 40px;
                        height: 40px;
                        background: #ff9898;
                        transform: rotate(38deg);
                        left: -22px;
                        top: -19px;
                    }
                }
            }
            .part2{
                display: flex;
                flex-direction: row;
                flex-wrap: wrap;
                align-items: flex-end;
                justify-content: flex-start;
                article{
                    border-left:1px solid #dfb6b6;
                    flex-basis: 20%;
                    padding-left: 10px;
                }
            }
        }
    `;

    const {pageName} = props;

    const navigate = useNavigate();

  return (
    <Hero>
        <Container>
           <div className='parent'>
           <div className='section part1'>
                <h1>{pageName} page</h1>
           </div>
           <div className='section part2'>
               <article>
                    <h6>total</h6>
                    <span>586</span>
                </article>
                <article>
                    <h6>total</h6>
                    <span>586</span>
                </article>
                <article>
                    <h6>total</h6>
                    <span>586</span>
                </article>
           </div>
           </div>
        </Container>
    </Hero>
  )
}

export default Herosmall
